Yes, in Python, decorators can subtract existing functionality from an existing object without modifying its structure. This is achieved by using the `functools.wraps` function to preserve the original object's attributes and methods, while still modifying its behavior.

Here's an example:
```python
from functools import wraps

def my_function():
    print("Called my function")

@wraps(my_function)
def my_decorated_function():
    # Do something else here
    return my_function()
